import styled from "styled-components";
export const Container = styled.div`
  display: flex;
  align-items: center;
`;

export const Left = styled.div`
  display: flex;
  margin-left: 25%;
  margin-right: 20%;
  color: red;
  cursor: pointer;
  :hover {
    color: #7c0d0d;
  }
`;
export const Input = styled.input`
  display: flex;
  padding-left: 205;
`;
export const Right = styled.div`
  display: flex;
  gap: 50px;
  align-items: center;
